import React, { Component } from 'react';

class Tablexml extends Component {

    constructor(props) {
        super(props);
        this.state = {
            data: this.props.data,
        };

        this.showResult = this.showResult.bind(this);
        this.addTableRowsFromXmlDoc = this.addTableRowsFromXmlDoc.bind(this);
        // this.getKeys = this.getKeys.bind(this);
        // this.onSort = this.onSort.bind(this);
        // this.handleChange = this.handleChange.bind(this);
    }

    // removeWhitespace = function (xml) {
    //     console.log(xml, 'docxml');
    //     var loopIndex;
    //     for (loopIndex = 0; loopIndex < xml.childNodes.length; loopIndex++) {
    //         var currentNode = xml.childNodes[loopIndex];
    //         if (currentNode.nodeType == 1) {
    //             this.removeWhitespace(currentNode);
    //         }
    //         if (!(/\S/.test(currentNode.nodeValue)) && (currentNode.nodeType == 3)) {
    //             xml.removeChild(xml.childNodes[loopIndex--]);
    //         }
    //     }
    // }

    addTableRowsFromXmlDoc = function (xmlNodes, tableNode) {
        console.log(tableNode, 'table');
        var theTable = tableNode.parentNode;
        var newRow, newCell, i, j;
        console.log("Number of nodes: " + xmlNodes.length);
        for (i = 0; i < xmlNodes.length; i++) {
            newRow = tableNode.insertRow(i);
            newRow.className = (i % 2) ? "OddRow" : "EvenRow";
            for (j = 0; j < xmlNodes[i].childNodes.length; j++) {
                newCell = newRow.insertCell(newRow.cells.length);
                if (xmlNodes[i].childNodes[j].firstChild) {
                    newCell.innerHTML = xmlNodes[i].childNodes[j].firstChild.nodeValue;
                } else {
                    newCell.innerHTML = "-";
                }
                console.log("cell: " + newCell);
            }
        }
        theTable.appendChild(tableNode);
    }

    showResult = function (xmlDoc) {
        // this.removeWhitespace(xmlDoc);
        // const r = <tbody id="BodyRows"></tbody>
        // var outputResult = document.getElementById("BodyRows");
        // console.log(outputResult, 'output');


        let rows = [];
        var xmlNodes = xmlDoc.getElementsByTagName("Item");
        var i, j;
        for (i = 0; i < xmlNodes.length; i++) {
            let rowID = `row${i}`;
            let cell = [];
            for (j = 0; j < xmlNodes[i].childNodes.length; j++) {
                let cellID = `cell${i}-${j}`;
                if (xmlNodes[i].childNodes[j].firstChild) {
                    cell.push(<td key={cellID} id={cellID}>{xmlNodes[i].childNodes[j].firstChild.nodeValue}</td>)
                } else {
                    cell.push(<td key={cellID} id={cellID}>{"-"}</td>)
                }
            }
            rows.push(<tr key={i} id={rowID}>{cell}</tr>)
        }
    }

    render() {
        var newdata = this.state.data;

        return (
            <table id="MainTable">
                <tbody id="BodyRows">
                    {this.showResult(newdata)}
                </tbody>

            </table>
        );
    }
}

export default Tablexml;
